import React from 'react';

interface IMencionedMembers{
    members : any;
}

const MencionedMembers : React.FC<IMencionedMembers> = ({members}) => {
    return(
        <ul className="list-group" style={{ textAlign: "start", position: "absolute", bottom: 45 }}>
            <div className="list-group-item">@Daniel Cassiano</div>
            <div className="list-group-item">@Lucas Carvalho</div>
            <div className="list-group-item">@Kaline Estevam</div>
            <div className="list-group-item">@Romero Caetano</div>
            <div className="list-group-item">@Jos√© Roberto</div>
        </ul>
    );
}

export default MencionedMembers;
